column1:
Note: 

1. E_Gibbs: total Gibbs free energy of molecule (Hartree); 

2. ZPE: zero point energy of molecule (kcal/mol);

3. E_solvation: solvation energy of molecule (kcal/mol);

4. E_LUMO: lowest unoccupied molecular orbital energy level of molecule (kcal/mol);

5. Entropy: total entropy of the molecule (Hartree).
